import React, { useState } from 'react';

export default function SpecialReason() {
  const [selectedName, setSelectedName] = useState(null);
  const base64 = ""
  const handleNameClick = (name, data) => {
    const blob = new Blob([data], { type: 'application/pdf' });
    const downloadUrl = URL.createObjectURL(blob);
    const link = document.createElement('a');
    link.href = downloadUrl;
    link.download = name;
    link.click();
    URL.revokeObjectURL(downloadUrl);
  }

  const handleReturnClick = () => {
    setSelectedName(null);
  }

  if (selectedName) {
    const { name, data } = selectedName;
    return (
      <div>
        <button onClick={handleReturnClick}>Return</button>
        <h2>Absence Reason</h2>
        <div>
          <p>Name: {name}</p>
          <button onClick={() => handleNameClick(name, data)}>Download PDF</button>
        </div>
      </div>
    )
  }

  return (
    <div>
      <h2>Absence Reason</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>ID</th>
            <th>Reason</th>
            <th>Checkbox</th>
          </tr>
        </thead>
        <tbody>
          <tr onClick={() => setSelectedName({ name: 'John Doe.pdf', data: base64 })}>
            <td>John Doe.pdf</td>
            <td>123456</td>
            <td>Health</td>
            <td><input type="checkbox" /></td>
          </tr>
          <tr onClick={() => setSelectedName({ name: 'Jane Smith.pdf', data: base64 })}>
            <td>Jane Smith.pdf</td>
            <td>789012</td>
            <td>Travel</td>
            <td><input type="checkbox" /></td>
          </tr>
          <tr onClick={() => setSelectedName({ name: 'Bob Johnson.pdf', data: base64 })}>
            <td>Bob Johnson.pdf</td>
            <td>345678</td>
            <td>Other</td>
            <td><input type="checkbox" /></td>
          </tr>
        </tbody>
      </table>
    </div>
  )
}
